import React from "react";
import { FaGithub, FaLinkedin } from "react-icons/fa";

const Hero = () => {
  return (
    <section className="bg-[#eef4fe] min-h-[500px] flex items-center justify-center text-center px-4">
      <div className="text-gray-800 max-w-2xl">
        <h1 className="text-4xl sm:text-5xl font-bold">Hi, I'm Pavithra</h1>
        <p className="mt-4 text-lg sm:text-xl">Full Stack Developer</p>

        <div className="flex justify-center gap-6 mt-6 text-2xl text-gray-700">
          <a href="https://github.com/pavithra123456678" target="_blank" rel="noreferrer">
            <FaGithub />
          </a>
          <a href="https://linkedin.com" target="_blank" rel="noreferrer">
            <FaLinkedin />
          </a>
        </div>
      </div>
    </section>
  );
};

export default Hero;
